import React from 'react';
import MainLayout from '../components/MainLayout';
import './StockDetail.css';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  LineElement,
  CategoryScale,
  LinearScale,
  PointElement,
  BarElement,
  BarController,
} from 'chart.js';

ChartJS.register(
  LineElement,
  CategoryScale,
  LinearScale,
  PointElement,
  BarElement,
  BarController
);

export default function StockDetail() {
  const lineData = {
    labels: ['09:00', '10:00', '11:00', '12:00', '13:00', '14:00'],
    datasets: [
      {
        label: '주가',
        data: [55300, 55200, 55000, 55100, 55200, 55300],
        borderColor: '#007bff',
        backgroundColor: 'rgba(0, 123, 255, 0.1)',
        tension: 0.3,
        fill: true,
      },
    ],
  };

  const barData = {
    labels: ['09', '10', '11', '12', '13', '14'],
    datasets: [
      {
        label: '거래량',
        data: [500, 800, 300, 700, 900, 650],
        backgroundColor: 'rgba(0, 0, 0, 0.1)',
      },
    ],
  };

  return (
    <div className="stock-detail">
      <div className="stock-header">
        <img src="/images/samsung.png" alt="삼성전자" className="stock-logo" />
        <div className="stock-info">
          <h2>삼성전자</h2>
          <p className="stock-price">55,300원</p>
          <p className="stock-change down">▼ 1,100원 (-1.9%)</p>
        </div>
      </div>

      <div className="stock-chart">
        <Line data={lineData} />
      </div>

      <div className="stock-volume">
        <Line data={barData} />
      </div>
    </div>
  );
}
